    for j in np.unique(freqarr):
        if freqarr.count(j) % j != 0:
            return -1
    num = 1
    dic = {}
    lex = []
    for i in freqarr:
        if i not in dic:
            dic[i] = (num, i - 1)
            num += 1
        elif dic[i][2] != 0:
            (num_, i_) = dic[i]
            dic[i] = (num_, i_ - 1)
        else:
            dic[i] = (num, i - 1)
            num += 1
        lex.append(dic[i][0])
    return lex

